contracts/Developer.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.8.2 <0.9.0;

import "@openzeppelin/contracts/access/Ownable.sol";
/*
    Данный контракт выполняет функцию менеджмента для разработчкив (например фкнуционал распределения дохода)
    На этот контракт будет приходить весь доход платформы.

    !NB Изменения данных может вносить только кошелёк который создал данный контракт.
*/
contract Developer is Ownable {
    address payable public developerWallet;

    constructor(address payable _developerWallet, address _initialOwner) Ownable(_initialOwner) {
        require(_developerWallet != address(0), "Developer wallet address cannot be zero.");
        developerWallet = _developerWallet;
    }

    // Функция для изменения адреса кошелька разработчиков
    function setDeveloperWallet(address payable _newWallet) external onlyOwner {
        require(_newWallet != address(0), "New wallet address cannot be zero.");
        developerWallet = _newWallet;
    }

    // Функция для вывода всех средств с контракта на кошелек разработчиков
    function withdraw() external onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No funds available for withdrawal.");
        developerWallet.transfer(balance);
    }

    // Позволяет контракту принимать ETH напрямую
    receive() external payable {}

    // Вспомогательная функция для проверки баланса контракта
    function getBalance() public view onlyOwner returns (uint256) {
        return address(this).balance;
    }
}

